import { ScrollView, StyleSheet, View } from "react-native";
import StartGame from "./src/screens/StartGame";

export default function App() {
  return (
    <ScrollView>
      <View style={styles.container}>
        <StartGame />
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
